            defaultZoom={this.state.zoom}
          >

            {/* <Marker
              lat={this.state.lat}
              lng={this.state.lng}
              name={this.props.activity.name}
              color='blue'
            /> */}
          </GoogleMapReact>
          : null}

      </div>
    );
  }
}

export default BigMap;
